                new Movie {Id = 35, DirectorId = 27, GenreId = 1, Title = "Blazing Saddles", Description = "In this satirical take on Westerns, crafty railroad worker Bart (Cleavon Little) becomes the first black sheriff of Rock Ridge, a frontier town about to be destroyed in order to make way for a new railroad. Initially, the people of Rock Ridge harbor a racial bias toward their new leader. However, they warm to him after realizing that Bart and his perpetually drunk gunfighter friend (Gene Wilder) are the only d", Year = 1974, IsForeign = false, Length = "93min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Hulu, Fubu, Paramount, Peacock,Sling, Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 36, DirectorId = 28, GenreId = 1, Title = "The Hangover", Description = "Two days before his wedding, Doug (Justin Bartha) and three friends (Bradley Cooper, Ed Helms, Zach Galifianakis) drive to Las Vegas for a wild and memorable stag party. In fact, when the three groomsmen wake up the next morning, they can't remember a thing; nor can they find Doug. With little time to spare, the three hazy pals try to re-trace their steps and find Doug so they can get him back to Los Angeles in time to walk down the aisle.", Year = 2009, IsForeign = false, Length = "96min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                 new Movie {Id = 37, DirectorId = 28, GenreId = 1, Title = "The Hangover Part II ", Description = "Two days before his wedding, Doug (Justin Bartha) and three friends (Bradley Cooper, Ed Helms, Zach Galifianakis) drive to Las Vegas for a wild and memorable stag party. In fact, when the three groomsmen wake up the next morning, they can't remember a thing; nor can they find Doug. With little time to spare, the three hazy pals try to re-trace their steps and find Doug so they can get him back to Los Angeles in time to walk down the aisle.", Year = 2011, IsForeign = false, Length = "96min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 38, DirectorId = 28, GenreId = 1, Title = "The Hangover Part III", Description = "It's been two years since the gang known as the Wolfpack narrowly escaped disaster in Bangkok. Now, Phil (Bradley Cooper), Stu (Ed Helms) and Doug (Justin Bartha) have happy lives at home -- but Alan (Zach Galifianakis) doesn't. Still lacking contentment and a sense of purpose, Alan has gone off his meds and surrendered to his natural impulses. It's up to the other members of the Wolfpack to get him through his personal crisis by embarking on a road trip to the place it all began: Las Vegas.", Year = 2013, IsForeign = false, Length = "100min", Rating = "2.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Apple TV, Vudu,  Amazon Prime, Hulu, Redbox, The Roku Channel, Google Play Movies & TV" },
                new Movie {Id = 39, DirectorId = 29, GenreId = 1, Title = "Groundhog Day", Description = "A cynical TV weatherman finds himself reliving the same day over and over again when he goes on location to the small town of Punxsutawney to film a report about their annual Groundhog Day. His predicament drives him to distraction, until he sees a way of turning the situation to his advantage.", Year = 1993, IsForeign = false, Length = "101min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "The Roku Channel, Google Play Movies & TV, Netflix, Amazon Prime" },
                new Movie {Id = 40, DirectorId = 30, GenreId = 1, Title = "Dumb and Dumber", Description = "Imbecilic best friends Lloyd Christmas (Jim Carrey) and Harry Dunne (Jeff Daniels) stumble across a suitcase full of money left behind in Harry's car by Mary Swanson (Lauren Holly), who was on her way to the airport. The pair decide to go to Aspen, Colo., to return the money, unaware that it is connected to a kidnapping. As Harry and Lloyd -- who has fallen in love with Mary -- are pursued across the country by hired killers and police, they find both their friendship and their brains tested.", Year = 1994, IsForeign = false, Length = "113min", Rating = "3.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 41, DirectorId = 31, GenreId = 1, Title = "Dumb and Dumberer: When Harry Met Lloyd", Description = "After years of homeschooling, dim-bulb teen Harry Dunne (Derek Richardson) finally makes the leap to public school and meets the equally intellectually challenged Lloyd Christmas (Eric Christian Olsen). The duo land in a \"special needs\" class created by Principal Collins (Eugene Levy) in order to bilk money from parents to fund his condo in Waikiki, Hawaii. His corruption is discovered by Jessica (Rachel Nichols), a fellow student who asks Harry and Lloyd to help her prove Collins' guilt.", Year = 2003, IsForeign = false, Length = "85min", Rating = "1/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 42, DirectorId = 30, GenreId = 1, Title = "Dumb and Dumber To", Description = "In need of a new kidney and having learned that he has a long-lost daughter, dimwit Harry Dunne (Jeff Daniels) snaps his equally cretinous pal, Lloyd Christmas (Jim Carrey), out of an apparent fugue state to accompany him on a journey to find her. The witless wonders criss-cross the country using whatever mode of transportation they can find, ultimately arriving at the one place on Earth where they least belong: a summit of the world's most brilliant minds", Year = 2014, IsForeign = false, Length = "109min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 43, DirectorId = 32, GenreId = 1, Title = "Shaun of the Dead", Description = "Shaun is a 30-something loser with a dull, easy existence. When he's not working at the electronics store, he lives with his slovenly best friend, Ed, in a small flat on the outskirts of London. The only unpredictable element in his life is his girlfriend, Liz, who wishes desperately for Shaun to grow up and be a man. When the town is inexplicably overrun with zombies, Shaun must rise to the occasion and protect both Liz and his mother.", Year = 2004, IsForeign = false, Length = "97min", Rating = "3.9/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu, Peacock, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 44, DirectorId = 30, GenreId = 2, Title = "There's Something About Mary", Description = "Ted's (Ben Stiller) dream prom date with Mary (Cameron Diaz) never happens due to an embarrassing injury at her home. Years later, Ted hires Pat Healy (Matt Dillon) to track down Mary so he can reconnect with her. Pat lies to Ted about Mary and he finds out everything he can about her to trick her into dating him. Ted travels to meet Mary and has to weave through the web of lies that Pat and Mary's friend Tucker (Lee Evans) have woven to try and win her over.", Year = 1998, IsForeign = false, Length = "130min", Rating = "4.1/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "FXNOW, Hulu, Peacock, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 45, DirectorId = 33, GenreId = 1, Title = "Rush Hour", Description = "When a Chinese diplomat's daughter is kidnapped in Los Angeles, he calls in Hong Kong Detective Inspector Lee (Jackie Chan) to assist the FBI with the case. But the FBI doesn't want anything to do with Lee, and they dump him off on the LAPD, who assign wisecracking Detective James Carter (Chris Tucker) to watch over him. Although Lee and Carter can't stand each other, they choose to work together to solve the case on their own when they figure out they've been ditched by both the FBI and police.", Year = 1998, IsForeign = false, Length = "97min", Rating = "3.2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 46, DirectorId = 33, GenreId = 1, Title = "Rush Hour 2", Description = "After an explosion at the US Embassy in Hong Kong kills two customs agents investigating currency smuggling, Inspector Lee (Jackie Chan) and James Carter (Chris Tucker) search for the mastermind. Ricky Tan (John Lone), head of the Fu-Cang-Long Triad, sends out his minions to insure that Carter and Lee don't solve the case.", Year = 2001, IsForeign = false, Length = "90min", Rating = "3.3/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 47, DirectorId = 33, GenreId = 1, Title = "Rush Hour 3", Description = "East meets West again when the assassination of Ambassador Han leads to the reunion of Lee (Jackie Chan) and Carter (Chris Tucker). In Paris, the pair must stay one step ahead of Chinese gangsters, and Lee's childhood friend (Hiroyuki Sanada), as they track down an envelope containing the identity of a powerful crime lord.", Year = 2007, IsForeign = false, Length = "91min", Rating = "4/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 48, DirectorId = 33, GenreId = 1, Title = "Money Talks", Description = "Reporter James (Charlie Sheen) brings petty crook Franklin (Chris Tucker) to justice, but as Franklin is being taken to jail, he is unwittingly drawn into a violent prison break. The police pursue Franklin, mistakenly thinking he killed several officers, so the fugitive turns to James for help. Figuring he has stumbled upon the story of a lifetime, the journalist agrees to prove that Franklin is innocent. Unfortunately, things don't go smoothly, and both men find themselves on the run.", Year = 1997, IsForeign = false, Length = "97min", Rating = "3.2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 49, DirectorId = 34, GenreId = 1, Title = "Coming to America", Description = "Prince Akeem (Eddie Murphy) is the prince of a wealthy African country and wants for nothing, except a wife who will love him in spite of his title. To escape an arranged marriage, Akeem flees to America accompanied by his persnickety sidekick, Semmi (Arsenio Hall), to find his queen. Disguised as a foreign student working in fast food, he romances Lisa (Shari Headley), but struggles with revealing his true identity to her and his marital intentions to his king father (James Earl Jones).", Year = 1988, IsForeign = false, Length = "116min", Rating = "3.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 50, DirectorId = 35, GenreId = 1, Title = "The Nutty Professor", Description = "Brilliant and obese scientist Sherman Klump (Eddie Murphy) invents a miraculous weight-loss solution. After a date with chemistry student Carla Purty (Jada Pinkett) goes badly, a depressed Klump tries the solution on himself. Though he instantly loses 250 pounds, the side effects include a second personality: an obnoxiously self-assertive braggart who calls himself Buddy Love. Buddy proves to be more popular than Sherman, but his arrogance and bad behavior quickly spiral out of control.", Year = 1996, IsForeign = false, Length = "95min", Rating = "2.5/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 51, DirectorId = 36, GenreId = 1, Title = "Nutty Professor II: The Klumps", Description = "A guy is getting married, but his alter-ego keeps breaking through. Determined to rid himself of his pesky partner, he extracts his alter-ego's genes, but an accident and a dog hair see the later-ego take on his own life. Unaware of his existence, the man and his wife perfect their new rejuvenation formula and their fortune seems assured until his alter-ego steals it.", Year = 2000, IsForeign = false, Length = "106min", Rating = "2/5", Rated = "PG-13", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Roku Channel, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu" },
                new Movie {Id = 52, DirectorId = 37, GenreId = 1, Title = "Life", Description = "During Prohibition, loudmouth Harlem grifter Ray (Eddie Murphy) and the no-nonsense Claude (Martin Lawrence) team up on a bootlegging mission to Mississippi that could bring them big bucks. But they run into trouble when a crooked lawman hits them with a phony murder charge. Ray and Claude are given life sentences and shipped off to jail, where they must think of a way to prove their innocence and avoid the brutal guards while battling their biggest enemies -- their opposing personalities.", Year = 1999, IsForeign = false, Length = "108min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Peacock" },
               new Movie {Id = 53, DirectorId = 39, GenreId = 1, Title = "Beverly Hills Cop", Description = "After his childhood buddy is murdered while visiting Detroit, rebellious cop Axel Foley (Eddie Murphy) follows the leads to Beverly Hills, Calif., under the auspices of a vacation. He checks in with old friend Jenny Summers (Lisa Eilbacher) and starts to believe her boss, art dealer Victor Maitland (Steven Berkoff), might somehow be involved in the murder. However, Lt. Bogomil (Ronny Cox) of the Beverly Hills Police Department does not trust Foley, and hinders his search for evidence.", Year = 1984, IsForeign = false, Length = "105min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                 new Movie {Id = 54, DirectorId = 40, GenreId = 1, Title = "Beverly Hills Cop II", Description = "The hard-nosed Detroit cop from the original film returns to Los Angeles to help solve another case. This time he must direct his efforts towards unravelling the Alphabet Crimes, a series of robberies committed by leather-jacketed punks. The investigation puts him on the trail of an illegal arms dealer and his hit lady.", Year = 1987, IsForeign = false, Length = "103min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                new Movie {Id = 55, DirectorId = 34, GenreId = 1, Title = "Beverly Hills Cop III", Description = "When his boss is killed, Detroit cop Alex Foley (Eddie Murphy) finds evidence that the murderer had ties to a California amusement park called Wonder World. Returning to Beverly Hills once more, Foley reunites with Detective Billy Rosewood (Judge Reinhold) to solve the case. Along with Billy's new partner, Jon Flint (Héctor Elizondo), they discover that the security force of Wonder World is actually part of a counterfeit money operation headed by park manager Orrin Sanderson (John Saxon).", Year = 1994, IsForeign = false, Length = "105min", Rating = "2.5/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Hulu, Showtime, Paramount, fuboTV, Sling TV, Redbox, Amazon Prime, Google Play Movies & YV, Apple TV, Vudu," },
                new Movie {Id = 56, DirectorId = 41, GenreId = 1, Title = "House Party", Description = "Play's parents are out of town, and he's planning the house party to end all house parties. His best friend, Kid, wants to go more than anything, knowing Sydney (Tisha Campbell-Martin), the hottest girl in school, is sure to be there. But when Kid gets into a fight at school, his father grounds him. Still determined to go, Kid sneaks out of the house and faces one calamity after another as he makes his way to Play's house and the party of the school year.", Year = 1990, IsForeign = false, Length = "100min", Rating = "4/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 57, DirectorId = 42, GenreId = 1, Title = "House Party 2", Description = "Rapper-turned-scholar Kid (Christopher Reid) gets into college, but he runs out of cash just as classes start. Desperate for dough, he tries working in the cafeteria, but when his time spent serving slop to students starts to interfere with studying and his relationship with girlfriend Sidney (Tisha Campbell), he looks for a new plan. He calls up his old partner in partying, Play (Christopher Martin), and they organize a pajama shindig, where women dress scantily and men must pay to enter.", Year = 1991, IsForeign = false, Length = "94min", Rating = "3/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 58, DirectorId = 43, GenreId = 1, Title = "House Party 3", Description = "After more than their share of exploits, best friends Kid and Play (Christopher Reid, Christopher Martin) are growing up: Kid is marrying his girlfriend, Veda, and Play is trying to survive in the music business. But they face major hurdles in their maturation process. While Play plans a bachelor party, handles some raucous younger cousins and deals with the arrival in town of Kid's ex-girlfriend, he also tries to bring success to a new female rap group called Sex as a Weapon.", Year = 1994, IsForeign = false, Length = "104min", Rating = "2/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & YV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 59, DirectorId = 44, GenreId = 1, Title = "House Party 4: Down to the Last Minute", Description = "Teenager Jon Jon Harris (Marques Houston) just can't seem to help throwing a party after he volunteers to house-sit his wealthy uncle's spacious home. In addition to throwing the bash, the ever-ambitious Jon Jon also decides to audition for a record deal with his rhythm-and-blues ensemble, which includes two of his close friends. The group performs and the party rages, but Jon Jon is in for a surprise when he finds out that his uncle is returning sooner rather than later.", Year = 2001, IsForeign = false, Length = "94min", Rating = "2.5/5", Rated = "R", ImgUrl = "/data:image/jpeg;base64,", SteamingOn = "Amazon Prime, Google Play Movies & TV, Apple TV, Vudu, Tubi" },
                new Movie {Id = 60, DirectorId = 45, GenreId = 1, Title = "House Party", Description = "Aspiring club promoters and best buddies Damon and Kevin are barely keeping things together. Out of money, down on their luck and about to lose the roofs over their heads, they need a huge windfall to make their problems go away. They soon decide to host the party of the year at an exclusive mansion, which just happens to belong to none other than NBA superstar LeBron James.", Year = 2023, IsForeign = false, Length = "101min", Rating = "1.8/5", Rated = "R", ImgUrl = "data:image/jpeg;base64,", SteamingOn = "Max, Hulu Tubi, YouTube, Vude, Redbox, Apple TV, Google Play Movies & TV" },
